import React from 'react'

const InputField = (props) => {
  const{InputHead}=props.input;
  return (
    <div>
        <div className='WeeklyUpdate_Overalldetail_Field1'>
             <label className='WeeklyUpdate_Overalldetail_label'>{InputHead}</label><br/>
             <input  className="WeeklyUpdate_Overalldetail_input" type="text" />
        </div>
    </div>
  )
}

export default InputField
